import React from 'react';
import './App.css';
import Header from './components/Header.js';
import Slider from  './components/Slider.js';



function App() {
  const test = {
    width: "10px"
  }
  return (
    <div>
      <Header/>
      <div style={{marginBottom: "100px"}}></div>
      <div className="container" style={test}>
        <Slider/>
      </div>
    </div>
  );
}




export default App;
